import React from 'react'
import { useDispatch, useSelector } from "react-redux";
import './Home.css'
function Home() {
    const products = useSelector((state) => state.product.products);

    return (
        <div className='home'>

                <div className="home__top">
                    <h2>Learning Course</h2>
                    <table>
                <tbody>
                <tr>
                    <th className='title'>Your Courses</th>
                </tr>
            <tr >
                <th>Subject</th>
                <th>Lecturer</th>
                <th>Grade</th>
            </tr>
            {products.map((item)=>{
                return(

            <tr>
                <td className='Course'>{item.subject}</td>
                <td className='Lecturers'>{item.lecturer}</td>
                <td className='Grade'>F</td>
            </tr>


                )
            })}
            </tbody>

            </table>
            </div>

        </div>
    )
}

export default Home
